(1, 'About Expertcage.com', '<p>Expertcage is a platform strictly for professional help and NOT for university \r\nassignments. If you have difficulty with simulations, modelling, \r\nbusiness plans, song writing etc in that line, your able to sink \r\nhelp from experts through this platform.<br></p>We provide a platform for both solution seekers and solution providers, we are always trying to make your dealing with us as pleasant and as convenient as possible. Our standards are high and we accept only high-quality work.<br><img alt="" src="uploads/ask.png" border="0" hspace="" vspace=""><img alt="" src="uploads/ask.jpg" border="0" height="211" hspace="" vspace="" width="569"><br>');

