(1, 'Our Benefits', '', '', '<div class="banner-right">\r\n            <div class="banner-sign-ben"><h1>Our benefits:</h1></div><div class="banner-body"><ul><li>No registration fees and a free lifetime membership</li><li>Competitive salary</li><li>Wide variety of interesting projects and assignments</li><li>Enough room for personal growth</li><li>The right to manage the workload on your own</li><li>Writer Support Team available 24/7</li></ul><h3>If you have a college degree or if you have experience in one of the following fields, feel free to apply.</h3><div class="banner-left">\r\n    <div class="banner-sign">We need more writers proficient in the following disciplines:</div>\r\n    <ul><li class="banner-left-1">Mathematics</li><li class="banner-left-2">Accounting</li><li class="banner-left-3">Finance</li><li class="banner-left-4">Business Statistics</li><li class="banner-left-5">SPSS</li><li class="banner-left-6">Chemistry</li><li class="banner-left-7">Engineering</li></ul>\r\n</div>\r\n<p>The list is non-exhaustive. We do hire people who know their stuff. \r\nProfessional experience is appreciated, since we do provide many types \r\nof <em>non-academic writing jobs</em>.</p></div></div>');

