(1, 're', 'Requirements', 'some text here', '<h3>Requirements:</h3>\r\n<ul><li>A minimum of a bachelor''s degree  (higher academic level writers get access to more complex jobs)</li><li>Ability to use either of the payment options we support. See our <a name="" target="" classname="" class="" href="dashboard?payments">"Payments"</a> page for more information on how you would get paid</li><li>English language proficiency</li><li>Internet access</li></ul>\r\n\r\n<h3>What we offer:</h3>\r\n<ul><li>Both full- and part-time earning capacities </li><li>Flexible work schedule (choose the projects you like)</li><li>Confidentiality guarantee</li><li>User-friendly  interface</li></ul>\r\n\r\n<h3>It''s all about fair play</h3>\r\n<p>There is no catch. It''s easy as it is: expertcage.com offers freelance\r\n writing jobs. All you have to do to start making money is to apply your\r\n expertise from the comfort of your home. Our user-friendly control \r\npanel makes job hunting easy and saves you a lot of time.</p>\r\n<p><strong>Making money with us is easy!</strong></p>\r\n<ul><li>Fill out the <a name="" target="" classname="" class="" href="sign_up_type">registration form</a></li><li>Upload a sample of your work and prove that you have at least a bachelor''s degree</li><li>Take our grammar and formatting styles tests</li><li>Start your freelance career with expertcage.com!</li></ul>\r\n\r\n<h3>How we work:</h3>\r\n<ul><li>After you have been approved to start working, you can log into  your account and view available jobs</li><li>You will have a chance to apply for freelance writing projects in the user control panel whenever you feel like it</li><li>If you are assigned to the job, you can start working on it. Make sure you submit the completed work before the deadline</li><li>If you are consistent at delivering high-quality writing, bonuses will not keep themselves waiting</li></ul>');

