(1, 'Why Expertcage', '', '', '<p>Expertcage is a Professional services provider.  Professional services \r\nare occupations in the tertiary sector of the economy requiring special \r\ntraining in the arts or sciences. Some professional services require \r\nholding professional licenses such as architects, auditors, engineers, \r\ndoctors and lawyers. Other professional services involve providing \r\nspecialist business support to businesses of all sizes and in all \r\nsectors; this can include tax advice, supporting a company with \r\naccounting, or providing management advice.</p><p>Our terms and conditions are fair, and the price we pay for your work\r\n is high. Our user-friendly control panel is designed to ensure maximum \r\nease of communication between the writer and the client.</p>\r\n<p>Our business model is different from that of other companies. Our \r\ncompetitors usually take 75% of what the customer pays for the job. We, \r\non the other hand, pursue a pricing policy that is writer-friendly \r\nrather than supplier-oriented. We charge less since we don''t consider \r\nourselves to be a direct supplier of the writing jobs. We are merely an \r\nintemediary between you and the client (the customer who provided the \r\njob). </p><p>\r\n</p><p>We are always trying to make your dealing with us as pleasant and\r\n as convenient as possible. Our standards, nonetheless, are high and we \r\naccept only high-quality work.<br></p><p>Expertcage.com is one of the best freelance writing companies on the \r\nweb. We are looking forward to helping you put your writing skills to \r\nwork.\r\n\r\n</p><p><strong><a name="" target="" classname="" class="" href="signup">Register now</a> and start making money today!</strong></p>');
